INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(1, 1, 'El santo sigue siendo el máximo referente de la Lucha Libre Mexicana', 'muerte-del-santo', '<p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<img style=\"width: 800px;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"><span lang=\"es-ES\"><br></span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Este\r\nsábado 5 de febrero se cumplió un año más de la partida de\r\nRodolfo Guzmán Huerta, quien como el Enmascarado de Plata logró\r\ntrascender a nivel mundial.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\n38 años de su muerte, El Santo sigue siendo el máximo referente de\r\nla Lucha libre en México.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\npesar de que han existido grandes figuras dentro de la lucha libre en\r\nMéxico, hay uno que se convirtió en el máximo referente a nivel\r\nmundial, se trata del emblemático El Santo, el máximo ídolo de los\r\nmexicanos, quien este 5 de febrero, pero del año 1984, a la edad de\r\n66 años, partió de este mundo para formar parte del firmamento\r\nluchístico.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Fue\r\nasí que Rodolfo Guzmán Huerta, quien nació en Tulancingo, Hidalgo\r\nen 1917, dejaría un legado imborrable dentro de los cuadriláteros y\r\nel cine; pues logró protagonizar tanto como estrella principal y en\r\nmancuerna con el también legendario Blue Demon, varias películas\r\nllenas de acción en donde enfrentaba a terribles monstruos o\r\nsupervillanos.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\npesar de que este sábado 5 de febrero de 2022 se cumplieron 38 años\r\nde su partida, el emblemático ‘Enmascarado de Plata’ sigue\r\nestando presente en cada uno de los corazones de sus miles de\r\nfanáticos que lo vieron brillar en sus mejores años, pues gracias a\r\nsu hijo El Santo Jr., las nuevas generaciones han podido conocer la\r\nhistoria de la gran leyenda de la lucha libre mexicana.</span></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'A 38 AÑOS DE SU MUERTE, EL SANTO SIGUE SIENDO EL MÁXIMO REFERENTE DE LA LUCHA LIBRE EN MÉXICO', 'A 38 años de su muerte, El Santo sigue siendo el máximo referente de la Lucha libre en México.', 'Muerte, El santo.,Tulancingo', 0, '2023-08-17 15:30:23');
INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(2, 2, 'Así fueron las últimas horas del enmascarado de plata', 'enmascarado-de-plata', '<p><img style=\"width: 800px;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"></p><p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<span lang=\"es-ES\">El Santo sigue siendo recordado por todos los\r\nfanáticos de la lucha libre mexicana.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">¿De\r\nqué murió el Santo? Así fueron las últimas horas del enmascarado\r\nde plata.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Dentro\r\nde la majestuosa historia luchística en México, El Santo es sin\r\nduda el máximo referente de los encordados y uno de los ídolos que\r\nsigue latente a pesar de que las nuevas generaciones no crecieron\r\nviendo sus innumerables movimientos arriba del cuadrilátero, pues,\r\nhoy en día, la lucha libre ya es muy diferente a lo que se veía\r\nhace más de 50 años.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Originario\r\nde la bella ciudad de Tulancingo, Hidalgo, Rodolfo Guzmán Huerta o\r\nmejor conocido como El Santo es considerado el mejor luchador de\r\ntodos los tiempos, ya que su gran popularidad lo llevó incluso a la\r\npantalla grande donde inmortalizó varias películas a lado de la\r\nleyenda Blue Demon.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">El\r\nSanto perdió la vida a causa de un infarto y al día siguiente de su\r\ndeceso sus restos fueron llevados a los Mausoleos del Ángel donde\r\ndescansan y son visitados por cientos de fanáticos que lo recuerdan\r\ncon mucho cariño y enaltecen a la máxima leyenda de la lucha libre\r\nen México.</span></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'Así fueron las últimas horas del enmascarado de plata', 'El Santo sigue siendo recordado por todos los fanáticos de la lucha libre mexicana.', 'Enmascarado de Plata', 0, '2023-08-17 15:33:41');
INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(3, 2, 'El Santo: Así fue cuando mostró su ROSTRO ante las cámaras de televisión ', 'cuando-mostrar-su-rostro', '<p><img style=\"width: 50%;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"></p><p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<span lang=\"es-ES\">En un par de ocasiones, el Santo amagó con\r\nquitarse la máscara durante la década de los ochenta, justo cuando\r\nsu carrera dentro de la lucha libre comenzaba su desenlace</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Son\r\ncontados los luchadores que han pasado a la historia por sus\r\ncapacidades así como su identidad. Uno de ellos fue el Santo, icono\r\ndel pancracio nacional y que logró traspasar las fronteras. A pesar\r\nde su exposición mediática, el deportista fue muy cuidadoso de no\r\nmostrar su rostro. Pero en alguna ocasión realizó lo impensado.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">En\r\nun par de ocasiones, el Santo amagó con quitarse la máscara durante\r\nla década de los ochenta. Justo cuando su carrera dentro de la lucha\r\nlibre comenzaba su desenlace. El luchador se presentó en el programa\r\n\'Hoy mismo\', que era conducido por Guillermo Ochoa, en donde se quito\r\ny puso la máscara de manera muy rápida.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Revela\r\nsu identidad</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Fue\r\nen 1984, cuando Rodolfo Guzmán, nombre real del luchador, acudió al\r\nprograma \'Contrapunto\', con Jacobo Zabludovsky, donde volvió a\r\ndescubrir sus rostro de manera rápida, pero el momento cobró\r\nrelevancia cuando el periodista retransmitió la imagen durante el\r\nnoticiero 24 Horas en donde se congeló la imagen y se pudo conocer\r\nel rostro del legendario Santo.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Su\r\nparticipación en \'Contrapunto\' ocurrió el 26 de enero de 1984. Diez\r\ndías después, el mítico luchador perdió la vida. El domingo 5 de\r\nfebrero después de terminar un número de escapismo en el Teatro\r\nBlanquita le ocurrió un infarto al miocardio a las siete de la\r\nnoche. De inmediato fue llevado al Hospital Mocel. La segunda función\r\nde la noche no contó con el luchador.</span></p>\r\n<p lang=\"es-ES\" style=\"line-height: 108%; margin-bottom: 0.28cm\"><br>\r\n<br>\r\n\r\n</p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'El Santo: Así fue cuando mostró su ROSTRO ante las cámaras de televisión ', 'En un par de ocasiones, el Santo amagó con quitarse la máscara durante la década de los ochenta, justo cuando su carrera dentro de la lucha libre comenzaba su desenlace', 'Sin mascara', 0, '2023-08-17 15:35:44');
